import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
const Home = ({ products }) => {
  console.log(products);
  return (
    <div>
      <div className="colorlib-product">
        <div className="container">
          <div className="row">
            <div className="col-sm-8 offset-sm-2 text-center colorlib-heading">
              <h2>Best Sellers</h2>
            </div>
          </div>
          <div className="row row-pb-md">
            <div className="col-lg-3 mb-4 text-center">
              {products.map(({ id, name, image, price }, index) => (
                <div className="product-entry border" key={index}>
                  <a href="#" className="prod-img">
                    <img
                      src={products.image}
                      className="img-fluid"
                      alt="Free html5 bootstrap 4 template"
                    />
                  </a>
                  <div className="desc">
                    <h2>
                      <a href="#">Women's Boots Shoes Maca</a>
                    </h2>
                    <span className="price">$139.00</span>
                  </div>
                </div>
              ))}
              ;
            </div>
          </div>
          <div className="row">
            <div className="col-md-12 text-center">
              <p>
                <a href="#" className="btn btn-primary btn-lg">
                  Shop All Products
                </a>
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

Home.propTypes = {};

export default Home;
